import React, { useState } from 'react'
import Todos from './Todos';
const Usecall = () => {
    const[count,setcount]=useState(0);
    const increment=()=>{
        setcount(count+1)
    }
  return (
    <div>usecall


    <Todos/>
    <button onClick={increment}>incre</button>

    <h1>{count}</h1>

    </div>
  )
}

export default Usecall
